text_retweet:
@shecompassdotcom #repost ・・・
#sustainability expert and and #political consultant #elenachristopoulos may be a native of toronto, canada, but it’s her work in the united states that makes her one of the most sought-after resources for #womenempowerment. at 19, @elenaisgreen was the victim of a heinous college campus #sexualassault miraculously, she lived to talk about it. it wasn’t long before she realized her story could empower other women, especially #womenofcolor and the #lbgt community. 
christopoulos joined #theshecompassshow to talk about how she is using her voice and political position to ensure that all women’s voices, especially those that intersect race, class, and gender identity, are heard loud and clear. “for me to speak my truth was the way that i found healing,” says christopoulos. “what i would say to survivors is that i believe you and it’s not your fault. i stand with you and support you, and it’s time that this becomes the new normal.” on continuing the fight for empowerment of all women and uplifting #intersectionalfeminism, christopoulos reminds us that “it’s my job to hold the door open for another woman, to pass the baton on. i have always known what #whiteprivilege is and that i have it. if i don’t hold the space for people of color and lgbtqia people, they’re not even in the picture. the most important thing you can do for a survivor is to believe them; i want to facilitate other survivors telling their story and shine a light to help others.” #watchnow (#linkinbio) as christopoulos shares her story and what she’s doing right now to ensure the voices of all women are loud and clear. available on #itunes #soundcloud and #spotify for #download on 10.26 #woc #podcasting #podcast #tvshowhost #talkshow #host #womeninstem #womeninscience #femaleempowerment #metoo #swipeleft #anitahill #photo 📷 @fmurphy & @instagram

