text:
she is a warrior.
that fierce expression in her eyes? that’s not fearlessness. that’s a call to battle. to battle injustice, condescension, judgement, profiling, injustice, abuse, false illusions, misogyny, body-shaming, close mindedness, cowardice, inauthenticity, untruths, and ignorance from those who so carelessly wield their swords. and in these battles, she will risk blood, bruises, and scarring. but the scars she’ll wear with ferocious pride, because it takes a warrior to fight not only others, but herself, too. it takes a warrior to look at herself and say, “no. there’s more to me than this.” only a warrior could do this. only a warrior would. 
