text_retweet:
#repost @makeequal with @get_repost
・・・
// nytt projekt för män/killar inom idrott & fritid // hösten 2017 präglades av #metoo, även inom idrotts- och fritidssektorn. över 2000 kvinnor gick ihop under #timeout och delade med sig av sina berättelser om övergrepp och trakasserier. musiksektorn (#närmusikentystnar), dansvärlden (#tystdansa) och hästbranschen (#visparkarbakut) släppte liknande upprop.
idrotten skapades av män, för män. den vilar fortfarande på en manlig norm. men inte bara det. idrotten i sverige vilar på en man som är medelklass, vit, heterosexuell och utan normbrytande funktionsvariationer. rf:s och rfsl:s studie "hbtq och idrott” visar att många idrottsutövare som bryter mot heteronormen inom framförallt manlig lagidrott känner att de inte passar in. 40 % av aktiva idrottsutövande i pojklag utsätts för kränkningar visar en studie som organisationen friends släppte 2013. ”taskiga kommentarer” är vanligaste kränkningen. ⚽️🤸🏽‍♂️🎤🐎 med anledning av detta släpper vi nu projektet allt vi inte pratar om – fritid och idrott, en förlängning av satsningen med samma namn, men nu med fokus på idrotts- och fritidssektorn samt för killar och män mellan 15-25 år. projektet kommer att pågå under två års tid och finansieras av svenska 
@postkodstiftelsen. medarbetare i projektet är henrik teljfors, johan pettersson, tanvir mansur och thor rutgersson. vi ser fram emot en ny säsong av podden, nya samarbeten och nya metoder för att alla killar och män ska kunna vara sig själva och därför också låta andra vara sig själva! #alltviintepratarom #makeequal 👀 syntolkning: formgiven bild med allt vi inte pratar om-loggan samt porträtt och förnamn på de fyra medarbetarna.

