text:
@ulrikkehoyer was in japan awaiting to walk a louis vuitton show when she was deemed to have a ‘very bloated stomach’, ‘bloated face’ and told to ‘only drink water for the next 24 hours’ by the casting director alexia for ashley brakow. at breakfast, starving, ulrikke ate the minimum before her plate was taken away as alexia checked if she had eaten. 10 hours later alexia was called by her agency in denmark who informed her she was cancelled from the show she was currently awaiting to walk and being sent home across the world. 
this story is sadly just part of many model’s realities. being ‘optioned’ for exclusive shows at fashion week, meaning they are held back from all other shows, only to have it dropped. being confirmed for jobs to have them cancelled even on the day, often with no cancellation fee payable - whereas if the model were even to be sick too attend work they could be sued for the production costs without a valid medical certificate. they don’t get to choose holidays and take sick days as ‘self employed workers’ because they don’t have any. the imbalance of power is real, and it is grossly unjust. 
show your support for ‘bloated’ @ulrikkehoyer by signing the petition to stop this from being such an accepted part of the industry.

